
const initialState = {
    cars: []
  };
  
  
  const carBrands = [
    { name: "Toyota", logo: "data:image/jpeg;base64," },
    { name: "BMW", logo: "data:image/jpeg;base64," },
    { name: "Mercedes", logo: "data:image/jpeg;base64," },
    { name: "Audi", logo: "data:image/jpeg;base64," },
    { name: "Tesla", logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT91hKFZFD9k_H3HumAuHZ48ws44cQmPFtsNw&s" },
    { name: "Ford", logo: "data:image/jpeg;base64," },
    { name: "Honda", logo: "data:image/jpeg;base64," },
    { name: "Nissan", logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRtdhe43_dFknM4jSUD3jRCEAk_kgp6F6y-9Q&s" },
    { name: "Chevrolet", logo: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQOd9qzJFdVUpnWwuYvvev71ptbl-6viix8dw&s" },
    { name: "Hyundai", logo: "data:image/jpeg;base64," }
  ];
  

  const ADD_CAR = "ADD_CAR";
  const ADD_5_CARS = "ADD_5_CARS";
  const REMOVE_5_CARS = "REMOVE_5_CARS";
  
  
  export const addCar = () => ({ type: ADD_CAR });
  export const add5Cars = () => ({ type: ADD_5_CARS });
  export const remove5Cars = () => ({ type: REMOVE_5_CARS });
  
  
  const getRandomBrand = () => carBrands[Math.floor(Math.random() * carBrands.length)];
  
  
  export default function carReducer(state = initialState, action) {
    switch (action.type) {
      case ADD_CAR:
        return {
          ...state,
          cars: [...state.cars, getRandomBrand()]
        };
      case ADD_5_CARS:
        return {
          ...state,
          cars: [
            ...state.cars,
            ...Array(5).fill().map(() => getRandomBrand())
          ]
        };
      case REMOVE_5_CARS:
        return {
          ...state,
          cars: state.cars.slice(0, Math.max(0, state.cars.length - 5))
        };
      default:
        return state;
    }
  }
  